import React from 'react'

class Noice extends React.Component {
    state = {
        noice: []
    }

    componentDidMount = () => {
        fetch("/api/noice")
            .then(res => res.json())
            .then(noice => {
                this.setState({noice})
            })
    }

    render() {
        console.log(this.state.noice)
        return (
            <div>
                <h1>Noice</h1>
            </div>
        )
    }
}

export default Noice
